    <div id="instruction">
        画像をタップしてください<br>
        高画質画像に変化します<br><br>
        テストが終わりです　と出るまで繰り返してください
    </div>

    <div id="dialog">
        <p>画像が切り替わるのが遅く感じましたか？</p>
        <button id="yesButton">はい</button>
        <button id="noButton">いいえ</button>
    </div>

    <script>
        let delayTime = 0;
        const delayTimes = [0, 100, 250, 500, 750, 1000, 1500, 2000];
        let currentDelayIndex = 0;

        document.getElementById('image1').addEventListener('click', function() {
            document.getElementById('instruction').style.display = 'none';
            setTimeout(() => {
                document.getElementById('image2').style.display = 'block';
                setTimeout(() => {
                    document.getElementById('dialog').style.display = 'block';
                }, 250);  // 画像2表示後、遅らせてダイアログを表示
            }, delayTime);
        });

        document.getElementById('yesButton').addEventListener('click', function() {
            alert('これでテストは終わりです。　あなたの許容待ち時間は: ' + delayTime + 'ミリ秒付近です');
            document.getElementById('dialog').style.display = 'none';
        });

        document.getElementById('noButton').addEventListener('click', function() {
            if (delayTime === 2000) {
                alert('これでテストは終わりです。　あなたの許容待ち時間は: 2000ミリ秒です');
                document.getElementById('dialog').style.display = 'none';
            } else {
                currentDelayIndex = (currentDelayIndex + 1) % delayTimes.length;
                delayTime = delayTimes[currentDelayIndex];
                document.getElementById('image2').style.display = 'none';
                document.getElementById('dialog').style.display = 'none';
                document.getElementById('instruction').style.display = 'block';
            }
        });
    </script>
